import React from "react";


const Todo =({data}) =>{
	const datalist = data.map((da)=>{
		return(
			<div>
			<h1>{da.content}</h1>
		</div>
			
		)
		
	})
	
	return(
	{datalist}
		
	)
	
}
export default Todo
